import React from "react";
import "./CatsList.scss";

type Owner = {
  name: string;
};

type Cat = {
  id: string;
  name: string;
  age: number;
  owner: Owner;
};

type Props = {
  cats: Cat[];
};

function CatsList({ cats }: Props) {
  const list = cats.map((c) => (
    <tr key={c.id}>
      <td>{c.name}</td>
      <td>{c.age}</td>
      <td className={"owner-name"}>{c.owner.name}</td>
    </tr>
  ));

  return (
    <table>
      <thead>
        <tr>
          <th>Cat's name</th>
          <th>Age</th>
          <th>Owner's name</th>
        </tr>
      </thead>
      <tbody>{list}</tbody>
    </table>
  );
}

export default CatsList;
export type { Cat, Owner };
